('197', 'give_settings', 'a:48:{s:12:\"base_country\";s:2:\"US\";s:9:\"test_mode\";s:7:\"enabled\";s:8:\"currency\";s:3:\"USD\";s:17:\"currency_position\";s:6:\"before\";s:16:\"session_lifetime\";s:6:\"604800\";s:12:\"email_access\";s:7:\"enabled\";s:19:\"thousands_separator\";s:1:\",\";s:17:\"decimal_separator\";s:1:\".\";s:15:\"number_decimals\";i:2;s:26:\"sequential-ordering_status\";s:7:\"enabled\";s:3:\"css\";s:7:\"enabled\";s:11:\"floatlabels\";s:8:\"disabled\";s:7:\"welcome\";s:7:\"enabled\";s:13:\"company_field\";s:8:\"disabled\";s:17:\"name_title_prefix\";s:8:\"disabled\";s:14:\"forms_singular\";s:7:\"enabled\";s:14:\"forms_archives\";s:7:\"enabled\";s:13:\"forms_excerpt\";s:7:\"enabled\";s:17:\"form_featured_img\";s:7:\"enabled\";s:12:\"form_sidebar\";s:7:\"enabled\";s:10:\"categories\";s:8:\"disabled\";s:4:\"tags\";s:8:\"disabled\";s:5:\"terms\";s:8:\"disabled\";s:13:\"admin_notices\";s:7:\"enabled\";s:5:\"cache\";s:7:\"enabled\";s:19:\"uninstall_on_delete\";s:8:\"disabled\";s:18:\"the_content_filter\";s:7:\"enabled\";s:14:\"scripts_footer\";s:8:\"disabled\";s:20:\"agree_to_terms_label\";s:15:\"Agree to Terms?\";s:14:\"agreement_text\";s:1951:\"<p>Acceptance of any contribution, gift or grant is at the discretion of the Win Tickets. The  Win Tickets will not accept any gift unless it can be used or expended consistently with the purpose and mission of the  Win Tickets.</p>\n				<p>No irrevocable gift, whether outright or life-income in character, will be accepted if under any reasonable set of circumstances the gift would jeopardize the donor’s financial security.</p>\n				<p>The Win Tickets will refrain from providing advice about the tax or other treatment of gifts and will encourage donors to seek guidance from their own professional advisers to assist them in the process of making their donation.</p>\n				<p>The Win Tickets will accept donations of cash or publicly traded securities. Gifts of in-kind services will be accepted at the discretion of the Win Tickets.</p>\n				<p>Certain other gifts, real property, personal property, in-kind gifts, non-liquid securities, and contributions whose sources are not transparent or whose use is restricted in some manner, must be reviewed prior to acceptance due to the special obligations raised or liabilities they may pose for Win Tickets.</p>\n				<p>The Win Tickets will provide acknowledgments to donors meeting tax requirements for property received by the charity as a gift. However, except for gifts of cash and publicly traded securities, no value shall be ascribed to any receipt or other form of substantiation of a gift received by Win Tickets.</p>\n				<p>The Win Tickets will respect the intent of the donor relating to gifts for restricted purposes and those relating to the desire to remain anonymous. With respect to anonymous gifts, the Win Tickets will restrict information about the donor to only those staff members with a need to know.</p>\n				<p>The Win Tickets will not compensate, whether through commissions, finders\' fees, or other means, any third party for directing a gift or a donor to the Win Tickets.</p>\";s:21:\"babel_polyfill_script\";s:7:\"enabled\";s:19:\"paypal_verification\";s:7:\"enabled\";s:8:\"gateways\";a:3:{s:6:\"manual\";i:1;s:7:\"offline\";i:1;s:6:\"stripe\";i:1;}s:15:\"default_gateway\";s:6:\"manual\";s:31:\"global_offline_donation_content\";s:385:\"<p>In order to make an offline donation we ask that you please follow these instructions: </p><ol><li>Make a check payable to \"{sitename}\"</li><li>On the memo line of the check, please indicate that the donation is for \"{sitename}\"</li><li>Please mail your check to:</li></ol>{offline_mailing_address}<br><p>All contributions will be gratefully acknowledged and are tax deductible.</p>\";s:43:\"give_offline_donation_enable_billing_fields\";s:8:\"disabled\";s:23:\"donor_default_user_role\";s:10:\"give_donor\";s:42:\"offline-donation-instruction_email_message\";s:385:\"<p>In order to make an offline donation we ask that you please follow these instructions: </p><ol><li>Make a check payable to \"{sitename}\"</li><li>On the memo line of the check, please indicate that the donation is for \"{sitename}\"</li><li>Please mail your check to:</li></ol>{offline_mailing_address}<br><p>All contributions will be gratefully acknowledged and are tax deductible.</p>\";s:30:\"donation-receipt_email_message\";s:394:\"Dear {name},\n\nThank you for your donation. Your generosity is appreciated! Here are the details of your donation:\n\n<strong>Donor:</strong> {fullname}\n<strong>Donation:</strong> {donation}\n<strong>Donation Date:</strong> {date}\n<strong>Amount:</strong> {amount}\n<strong>Payment Method:</strong> {payment_method}\n<strong>Payment ID:</strong> {payment_id}\n\n{receipt_link}\n\n\n\nSincerely,\n{sitename}\n\";s:26:\"new-donation_email_message\";s:280:\"Hi there,\n\nThis email is to inform you that a new donation has been made on your website: {site_url}.\n\n<strong>Donor:</strong> {name}\n<strong>Donation:</strong> {donation}\n<strong>Amount:</strong> {amount}\n<strong>Payment Method:</strong> {payment_method}\n\nThank you,\n\n{sitename}\n\";s:22:\"new-donation_recipient\";a:1:{i:0;s:20:\"ivan@avenegas.com.mx\";}s:30:\"new-offline-donation_recipient\";a:1:{i:0;s:20:\"ivan@avenegas.com.mx\";}s:28:\"new-donor-register_recipient\";a:1:{i:0;s:20:\"ivan@avenegas.com.mx\";}s:25:\"new-donation_notification\";s:7:\"enabled\";s:26:\"sequential-ordering_number\";i:1;s:12:\"success_page\";i:29;s:12:\"failure_page\";i:30;s:12:\"history_page\";i:31;}', 'no'),
