('5', '1', '2020-03-24 23:48:08', '2020-03-24 23:48:08', '<label> Your Name (required)\n    [text* your-name] </label>\n\n<label> Your Email (required)\n    [email* your-email] </label>\n\n<label> Subject\n    [text your-subject] </label>\n\n<label> Your Message\n    [textarea your-message] </label>\n\n[submit \"Send\"]\nWin Tickets \"[your-subject]\"\nWin Tickets <ivan@avenegas.com.mx>\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on Win Tickets (http://localhost/winn_tickets)\nivan@avenegas.com.mx\nReply-To: [your-email]\n\n0\n0\n\nWin Tickets \"[your-subject]\"\nWin Tickets <ivan@avenegas.com.mx>\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on Win Tickets (http://localhost/winn_tickets)\n[your-email]\nReply-To: ivan@avenegas.com.mx\n\n0\n0\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2020-03-24 23:48:08', '2020-03-24 23:48:08', '', '0', 'http://localhost/winn_tickets/?post_type=wpcf7_contact_form&p=5', '0', 'wpcf7_contact_form', '', '0'),
